void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    // Normalized pixel coordinates (from 0 to 1)
    vec2 uv = (fragCoord-0.5*iResolution.xy*.25)/iResolution.y;

    vec3 col = vec3(0);

    float plot = ((uv.x+uv.x)*uv.x)*cos(iTime)/sin(iTime);

    if (uv.y < (plot-uv.y)) col = vec3(cos(iTime),sin(iTime * 0.12324235),cos(-iTime*3.1415));
    // Output to screen
    fragColor = vec4(col,1.0);
}
